import Form from "./components/Form";
import Navbar from "./components/Navbar";

function App() {
  return (
    <div className="w-screen h-screen bg-[#3C6255]">
      <Navbar />
      <div className="items-center justify-center max-w-7xl mx-auto p-10">
        <Form />
      </div>
    </div>
  );
}

export default App;
